import axios from 'axios'
import {GET_GENRE, POST_ACTIVE_GENRE} from '../constan/movie'
import {GET_GENRE_API} from '../constan/api'

export const GetGenre = (data) => ({
    type : GET_GENRE,
    payload : axios.get(GET_GENRE_API)
})

export const PostActiveGenre = (genre) =>({
    type : POST_ACTIVE_GENRE,
    payload : genre
})
